      font-size: 1pc;
      line-height: 2pc;
      font-family: sans-serif;
      background-color: #fff;
      color: #7c6992;
      overflow-x: hidden;
      display: flex;
      align-items: flex-start;
      justify-content: flex-start;
      flex-direction: column;
    }

    body>.container {
      width: 100%;
      flex: 1;
      display: flex;
      align-items: flex-start;
      justify-content: flex-start;
      flex-direction: column;
    }

    body .top-part {
      width: 100%;
      display: flex;
      align-items: stretch;
    }

    .top-part .left-side {
      width: 50%;
    }

    .top-part .left-side img {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }

    .top-part .right-side {
      width: 50%;
      display: flex;
      justify-content: center;
    }

    @media screen and (max-width: 1000px) {
      .top-part .left-side {
        display: none;
      }

      .top-part .right-side {
        width: 100%;
      }

    }

    .top-part .right-side form {
      display: flex;
      align-items: center;
      justify-content: center;
      flex-direction: column;
      padding: 2pc 1.4pc;
      max-width: 389px;
    }

    .top-part .right-side form .intro img {
      width: 50%;
      margin: 0 auto;
      display: block;
      margin-bottom: 2pc;
    }

    .top-part .right-side form .form-pack {
      width: 100%;
      display: flex;
      flex-direction: column;
    }

    label.cats {
      font-weight: normal;
      display: block;
      padding-top: .2pc;
      padding-bottom: .3pc;
    }

    input.cats {
      color: inherit;
      outline-offset: 1px;
      background-color: transparent;
      padding: 0.5rem .5rem;
      border: 0 none;
      outline: 0 none;
      width: 100%;
      border-radius: 0.4rem;
      padding-right: 2rem;
      transition: background-color .5s;
      border: 1px solid #7c6992;
      margin-bottom: .7pc;
    }

    input.cats:focus {
      outline: 2px solid #7c6992;
    }

    input.cats.xx {
      padding-right: 2.5pc;
      margin-bottom: 0;
    }

    div.eye-icon {
