    /* --------------------------------------------------------------------------------------------------------- */

    /* Customize the label (the container) */
    .top-part .right-side form .form-pack .container {
      display: block;
      position: relative;
      padding-left: 38px;
      margin-bottom: 12px;
      cursor: pointer;
      /* font-size: 22px; */
      -webkit-user-select: none;
      -moz-user-select: none;
      -ms-user-select: none;
      user-select: none;
    }

    /* Hide the browser's default checkbox */
    .top-part .right-side form .form-pack .container input {
      position: absolute;
      opacity: 0;
      cursor: pointer;
      height: 0;
      width: 0;
    }

    /* Create a custom checkbox */
    .checkmark {
      box-sizing: content-box;
      position: absolute;
      top: 0;
      left: 0;
      height: 25px;
      width: 25px;
      background-color: transparent;
      border: 2px solid #2e1a47;
      border-radius: 3px;
    }

    /* On mouse-over, add a grey background color */
    .top-part .right-side form .form-pack .container:hover input~.checkmark {
      background-color: #ccc;
    }

    /* When the checkbox is checked, add a blue background */
    .top-part .right-side form .form-pack .container input:checked~.checkmark {
      background-color: #2e1a47;
    }

    /* Create the checkmark/indicator (hidden when not checked) */
    .checkmark:after {
      content: "";
      position: absolute;
      display: none;
    }

    /* Show the checkmark when checked */
    .top-part .right-side form .form-pack .container input:checked~.checkmark:after {
      display: block;
    }

    /* Style the checkmark/indicator */
    .top-part .right-side form .form-pack .container .checkmark:after {
      left: 9px;
      top: 5px;
      width: 5px;
      height: 10px;
      border: solid white;
      border-width: 0 3px 3px 0;
      -webkit-transform: rotate(45deg);
      -ms-transform: rotate(45deg);
      transform: rotate(45deg);
    }

