    }

    .mid-part .end-view p+p.safe {
      margin-top: 0
    }

    .mid-part .end-view a {
      color: #2e1a47;
    }

    .end-part {
      padding: .5pc;
      background-color: #2e1a47;
      color: #7c6992;
