    }

    .end-part nav a:hover {
      color: #fff;
      text-decoration: underline;
    }

    .end-part nav a.head,
    .end-part nav div.head {
      flex: 1.2;
    }

    .end-part nav div.head img {
      width: 100%;
    }

    @media screen and (max-width: 1000px) {
      .end-part nav {
        flex-direction: column;
      }

      .end-part nav a {
        padding-bottom: .5pc;
      }

      .end-part nav div.head img {
        width: 30%;
      }

    }

    .finish {
      background-color: #000;
      color: #fff;
      text-align: center;
      padding: 1pc;
      width: 100%;
      font-size: 1.2pc;
    }
  </style>

</head>

<body>

